import React, { Component } from 'react';
import PropTypes from 'prop-types';

class Form extends Component {
  state = {
    name: '',
    phone
  }


  inputHeandler = e => {
    const input = e.target;
    const value = input.value;
    this.setState({
      title: value,
    });
  };
  render() {
    return (
      <form>
        <input placeholder="Enter name" type="text" name="name"></input>
        <input placeholder="Enter phone" type="text" name="phone"></input>
        <button type="submit">Add contacts</button>
      </form>
    );
  }
}

Form.propTypes = {};

export default Form;
